import React from 'react';
import Logo from "../common/Logo";
import {StyledHeader, StyledMenuLink, StyledMenuList} from "./styles";

function Menu() {
  const menuItems = [
    {'title': 'Home', 'href': '/'},
    {'title': 'About', 'href': '/about'},
    {'title': 'Pages', 'href': '/pages'},
    {'title': 'Shop', 'href': '/shop'},
    {'title': 'Projects', 'href': '/projects'},
    {'title': 'News', 'href': '/news'},
  ];

  return (
    <div>
      <StyledMenuList>
        {menuItems.map(item =>
          <li>
            <StyledMenuLink href={item.href}>{item.title}</StyledMenuLink>
          </li>
        )}
      </StyledMenuList>
    </div>
  )
}

function Header() {
  return (
    <>
      <StyledHeader>
        <Logo/>
        <Menu/>
        <div>

        </div>
      </StyledHeader>
    </>
  );
}

export default Header;
